import React from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import axios from 'axios';
import Typography from '@material-ui/core/Typography';

export default class SendFeedback extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      open: false,
      email:'',
      feedback: '',
      sent: false,
    };
    this.handleChange = this.handleChange.bind(this);
    this.handleEmailChange = this.handleEmailChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleOpen = this.handleOpen.bind(this);
    this.handleClose = this.handleClose.bind(this);
  };

  handleOpen() {
    this.setState({ open: true });
  };

  handleClose() {
    this.setState({ open: false });
  };

  handleChange  (e)  {
    this.setState({ feedback: e.target.value });
  };

  handleEmailChange  (e)  {
    this.setState({ email: e.target.value });
  };

  handleSubmit ()  {
    console.log(this.state);
    axios.post('/mail',{
      email:this.state.email
    });
    axios.post('/mail2',{
      email:this.state.email,
      feedback:this.state.feedback
    });
    this.setState({ sent: true });
  };

  render() {
    return (
      <div className="SendFeedback">
        <Button className="MainButton" variant="outlined" size="small" onClick={this.handleOpen} >Feedback</Button>
        <Dialog
          open={this.state.open}
          onClose={this.handleClose}
          aria-labelledby="form-dialog-title"
        >
        {!this.state.sent && (
          <div className="FeedbackPopUpForm">
            <div className="Title">
              <Typography variant="display2">Bugs & Feedback</Typography>
              <Typography variant="caption">Notify us about bugs and give us your suggestions! Help improve Source!</Typography>
            </div>
            <div className="Content">
              <TextField
                id="Email"
                label="Email"
                value={this.state.email}
                onChange={this.handleEmailChange}
                fullWidth
                margin="normal"
              />
              <TextField
                label="Your Feedback"
                multiline={true}
                value={this.state.feedback}
                onChange={this.handleChange}
                fullWidth
              />
            </div>
              <div className="Actions">
                <div>
                  <Button className="CancelButton" onClick={this.handleClose} color="secondary">
                    Cancel
                  </Button>
                </div>
                <div>
                  <Button className="SubmitButton" onClick={this.handleSubmit} color="primary">
                    Send Feedback
                  </Button>
                </div>
              </div>
            </div>
          )}
          {this.state.sent && (
            <div className="SentSuccessfullyPopUp">
              <Typography variant="display1">Thank you for helping us improve Source!</Typography>
              <div className="Action">
                <Button className="CloseButton" onClick={this.handleClose} variant="raised" color="primary">
                  Close
                </Button>
              </div>
            </div>
          )}
        </Dialog>
      </div>
    );
  }
}
